import React from 'react';

const ConferenceCard = ({ title }) => {
    return (
        <article className="conference-card">
            <h3 className="conference-title">{title}</h3>
            <button className="btn" aria-label={`Register for ${title}`}>
                View / Register
            </button>
        </article>
    );
};

export default ConferenceCard;
